db.patients.aggregate([
    {
        $match: {
            "OBSERVATIONS": {
                $elemMatch: {
                    "CODE": "DALY"
                }
            }
        }
    },
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $lookup: {
            from: "encounters",
            localField: "ENCOUNTERS._id",
            foreignField: "_id",
            as: "relatedEncounters"
        }
    },
    {
        $unwind: "$relatedEncounters"
    },
    {
        $group: {
            _id: "$relatedEncounters._id",
            ENCOUNTER_ID: "$relatedEncounters._id",
            START: "$relatedEncounters.START",
            STOP: "$relatedEncounters.STOP"
        }
    }
])
```

