```
db.patients.aggregate([
    {
        $match: {
            "MEDICATIONS": {
                $elemMatch: {
                    "CODE": "NDA020800 0.3 ML Epinephrine 1 MG/ML Auto-Injector"
                }
            }
        }
    },
    {
        $unwind: "$MEDICATIONS"
    },
    {
        $match: {
            "MEDICATIONS.BASE_COST": { $gt: 0 }
        }
    },
    {
        $group: {
            _id: "$MEDICATIONS.CODE",
            count: { $count: {} },
            successRate: { $divide: [ { $sum: "$MEDICATIONS.PAYER_COVERAGE" }, { $sum: "$MEDICATIONS.BASE_COST" } ] }
        }
    },
    {
        $project: {
            _id: 0,
            successRate: { $round: ["$successRate", 2] }
        }
    }
])
```

