```
db.patients.aggregate([
    {
        $match: {
            "PAYER_TRANSITIONS.PAYER_REF": "d18ef2e6-ef40-324c-be54-34a5ee865625"
        }
    },
    {
        $unwind: "$PAYER_TRANSITIONS"
    },
    {
        $lookup: {
            from: "patients",
            localField: "PAYER_TRANSITIONS.MEMBER_ID",
            foreignField: "_id",
            as: "patient"
        }
    },
    {
        $unwind: "$patient.CLAIMS"
    },
    {
        $group: {
            _id: "$patient._id",
            avgQualityOfLife: { $avg: "$patient.CLAIMS.CLAM_TRANSACTIONS.QOLS_AVG" }
        }
    },
    {
        $project: {
            _id: 0,
            avgQualityOfLife: 1
        }
    }
])
```

